import { useEffect, useState } from 'react';
import getIssues from '../services/issuesService';

const INITIAL_PAGE= 0;

export default function GetIssues({page}){
    const [issuesData, setIssuesData] = useState([]);

    const newData = {
        items: issuesData,
        card: 'issue'
      };

    useEffect(() => {
      const data = getIssues({page});
      setIssuesData(data);
    }, []); 
    console.log(newData);
    return(newData);
}
